INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'BRANCHES', 'Number of taken and not taken branches, including: conditional branches, jumps, calls, returns, software interrupts, and interrupt returns', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'BRANCHES_MISPREDICTED', 'Number of branch mispredictions that occurred on BTB hits. BTB misses are not considered branch mispredicts because no prediction exists for them yet.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'CODE_CACHE_MISS', 'Number of instruction reads that miss the internal code cache; whether the read is cacheable or noncacheable', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'CODE_PAGE_WALK', 'Number of code page walks', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'CODE_READ', 'Number of instruction reads; whether the read is cacheable or noncacheable', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'CPU_CLK_UNHALTED', 'Number of cycles during which the processor is not halted.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_CACHE_LINES_WRITTEN_BACK', 'Number of dirty lines (all) that are written back, regardless of the cause', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_PAGE_WALK', 'Number of data page walks', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_READ', 'Number of successful memory data reads committed by the K-unit (L1). Cache accesses resulting from prefetch instructions are included for A0 stepping.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_READ_MISS', 'Number of memory read accesses that miss the internal data cache whether or not the access is cacheable or noncacheable. Cache accesses resulting from prefetch instructions are not included.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_READ_MISS_OR_WRITE_MISS', 'Number of memory read and/or write accesses that miss the internal data cache, whether or not the access is cacheable or noncacheable', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_READ_OR_WRITE', 'Number of memory data reads and/or writes (internal data cache hit and miss combined). Read cache accesses resulting from prefetch instructions are included for A0 stepping.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_WRITE', 'Number of successful memory data writes committed by the K-unit (L1). Streaming stores (hit/miss L1), cacheable write partials, and UC promotions are all included.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'DATA_WRITE_MISS', 'Number of memory write accesses that miss the internal data cache whether or not the access is cacheable. Non-cacheable misses are not included.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'EXEC_STAGE_CYCLES', 'Number of E-stage cycles that were successfully completed. Includes cycles generated by multi-cycle E-stage instructions. For instructions destined for the FPU or VPU pipelines, this event only counts occupancy in the integer E-stage.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'FE_STALLED', 'Number of cycles where the front-end could not advance. Any multi-cycle instructions which delay pipeline advance and apply backpressure to the front-end will be included, e.g. read-modify-write instructions. Includes cycles when the front-end did not have any instructions to issue.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'INSTRUCTIONS_EXECUTED', 'Number of instructions executed (up to two per clock)', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'INSTRUCTIONS_EXECUTED_V_PIPE', 'Number of instructions executed in the V_pipe. The event indicates the number of instructions that were paired.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L1_DATA_HIT_INFLIGHT_PF1', 'Number of data requests which hit an in-flight vprefetch0. The in-flight vprefetch0 was not necessarily issued from the same thread as the data request.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L1_DATA_PF1', 'Number of data vprefetch0 requests seen by the L1.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L1_DATA_PF1_DROP', 'Number of data vprefetch0 requests seen by the L1 which were dropped for any reason. A vprefetch0 can be dropped if the requested address matches another in-flight request or if it has a UC memtype.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L1_DATA_PF1_MISS', 'Number of data vprefetch0 requests seen by the L1 which missed L1. Does not include vprefetch1 requests which are counted in L1_DATA_PF1_DROP.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L1_DATA_PF2', 'Number of data vprefetch1 requests seen by the L1. This is not necessarily the same number as seen by the L2 because this count includes requests that are dropped by the core. A vprefetch1 can be dropped by the core if the requested address matches another in-flight request or if it has a UC memtype.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_CODE_READ_MISS_CACHE_FILL', 'Number of code read accesses that missed the L2 cache and were satisfied by another L2 cache. Can include promoted read misses that started as DATA accesses.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_CODE_READ_MISS_MEM_FILL', 'Number of code read accesses that missed the L2 cache and were satisfied by main memory. Can include promoted read misses that started as DATA accesses.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_HIT_INFLIGHT_PF2', 'Number of data requests which hit an in-flight vprefetch1. The in-flight vprefetch1 was not necessarily issued from the same thread as the data request.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_PF1_MISS', 'Number of data vprefetch0 requests seen by the L2 which missed L2.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_PF2', 'Number of data vprefetch1 requests seen by the L2. Only counts vprefetch1 hits on A0 stepping.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_PF2_DROP', 'Number of data vprefetch1 requests seen by the L2 which were dropped for any reason.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_PF2_MISS', 'Number of data vprefetch1 requests seen by the L2 which missed L2. Does not include vprefetch2 requests which are counted in L2_DATA_PF2_DROP.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_READ_MISS_CACHE_FILL', 'Number of data read accesses that missed the L2 cache and were satisfied by another L2 cache. Can include promoted read misses that started as CODE accesses.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_READ_MISS_MEM_FILL', 'Number of data read accesses that missed the L2 cache and were satisfied by main memory. Can include promoted read misses that started as CODE accesses.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_WRITE_MISS_CACHE_FILL', 'Number of data write (RFO) accesses that missed the L2 cache and were satisfied by another L2 cache.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_DATA_WRITE_MISS_MEM_FILL', 'Number of data write (RFO) accesses that missed the L2 cache and were satisfied by main memory.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_READ_HIT_E', 'L2 Read Hit E State, may include prefetches on A0 stepping.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_READ_HIT_M', 'L2 Read Hit M State', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_READ_HIT_S', 'L2 Read Hit S State', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_READ_MISS', 'L2 Read Misses. Prefetch and demand requests to the same address will produce double counting.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_VICTIM_REQ_WITH_DATA', 'L2 received a victim request and responded with data', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'L2_WRITE_HIT', 'L2 Write HIT, may undercount on A0 stepping.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'LONG_CODE_PAGE_WALK', 'Number of long code page walks, i.e. page walks that also missed the L2 uTLB. Subset of DATA_CODE_WALK event', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'LONG_DATA_PAGE_WALK', 'Number of long data page walks, i.e. page walks that also missed the L2 uTLB. Subset of DATA_PAGE_WALK event', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'MEMORY_ACCESSES_IN_BOTH_PIPES', 'Number of data memory reads or writes that are paired in both pipes of the pipeline', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'MICROCODE_CYCLES', 'The number of cycles microcode is executing. While microcode is executing, all other threads are stalled.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'PIPELINE_AGI_STALLS', 'Number of address generation interlock (AGI) stalls. An AGI occurring in both the U- and V- pipelines in the same clock signals this event twice.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'PIPELINE_FLUSHES', 'Number of pipeline flushes that occur. Pipeline flushes are caused by BTB misses on taken branches, mispredictions, exceptions, interrupts, and some segment descriptor loads.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'PIPELINE_SG_AGI_STALLS', 'Number of address generation interlock (AGI) stalls due to vscatter* and vgather* instructions.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'SNP_HITM_BUNIT', 'Snoop HITM in BUNIT', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'SNP_HITM_L2', 'Snoop HITM in L2', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'SNP_HIT_L2', 'Snoop HIT in L2', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_DATA_READ', 'Number of read transactions that were issued. In general each read transaction will read 1 64B cacheline. If there are alignment issues, then reads against multiple cache lines will each be counted individually.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_DATA_READ_MISS', 'VPU L1 data cache readmiss. Counts the number of occurrences.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_DATA_WRITE', 'Number of write transactions that were issued. . In general each write transaction will write 1 64B cacheline. If there are alignment issues, then write against multiple cache lines will each be counted individually.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_DATA_WRITE_MISS', 'VPU L1 data cache write miss. Counts the number of occurrences.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_ELEMENTS_ACTIVE', 'Counts the cumulative number of elements active (via mask) for VPU instructions issued.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_INSTRUCTIONS_EXECUTED', 'Counts the number of VPU instructions executed in both u- and v-pipes.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_INSTRUCTIONS_EXECUTED_V_PIPE', 'Counts the number of VPU instructions that paired and executed in the v-pipe.', 'core', 13);
INSERT INTO lcpi_event (code, umask, name, description, type, processor_id) VALUES (0, 0, 'VPU_STALL_REG', 'VPU stall on Register Dependency. Counts the number of occurrences. Dependencies will include RAW, WAW, WAR.', 'core', 13);
